INSERT INTO `history` VALUES ('fda416007c85445cac315fa1fbd0f962', '你好', '你好！有什么我可以帮助你的吗？', 'test', 'null', '2025-12-06 05:48:33');
INSERT INTO `history` VALUES ('78d4f07ee2e4448f8e6422e28eca288e', '请生成一份结构化的简历信息，严格按照以下JSON格式返回：\n{\n  \"jobStatus\": \"在职/离职/应届生\",\n  \"jobTitle\": \"期望职位\",\n  \"salaryExpectation\": \"期望薪资\",\n  \"education\": {\n    \"school\": \"学校名称\",\n    \"major\": \"专业名称\",\n    \"degree\": \"学历\"\n  },\n  \"profession\": {\n    \"skill\": \"技能描述\"\n  },\n  \"work\": {\n    \"company\": \"公司名称\",\n    \"department\": \"部门名称\",\n    \"position\": \"职位名称\",\n    \"details\": \"工作内容描述\"\n  },\n  \"project\": {\n    \"name\": \"项目名称\",\n    \"details\": \"项目描述\"\n  },\n  \"award\": {\n    \"details\": \"获奖情况\"\n  }\n}\n\n基于以下信息生成应届生简历：\n专业：计算机科学与技术\n期望职位：大模型应用开发\n补充信息：\n', '```json\n{\n  \"jobStatus\": \"应届生\",\n  \"jobTitle\": \"大模型应用开发\",\n  \"salaryExpectation\": \"面议\",\n  \"education\": {\n    \"school\": \"清华大学\",\n    \"major\": \"计算机科学与技术\",\n    \"degree\": \"本科\"\n  },\n  \"profession\": {\n    \"skill\": \"熟悉Python、Java编程语言，掌握机器学习和深度学习基础知识，了解大模型的应用与开发，具备良好的团队协作和沟通能力。\"\n  },\n  \"work\": {\n    \"company\": \"N/A\",\n    \"department\": \"N/A\",\n    \"position\": \"N/A\",\n    \"details\": \"N/A\"\n  },\n  \"project\": {\n    \"name\": \"基于大模型的智能问答系统\",\n    \"details\": \"参与一个基于大模型的智能问答系统的开发项目，负责模型训练和优化，实现了自然语言处理和语义识别功能，提升了问答系统的准确性和响应速度。\"\n  },\n  \"award\": {\n    \"details\": \"获得2023年全国大学生计算机设计大赛一等奖。\"\n  }\n}\n```', 'test', 'null', '2025-12-06 05:53:42');
INSERT INTO `history` VALUES ('40fcff901de64e9aa3c01e216448d384', '推荐适合我的职位', '当然可以帮助你！不过，我需要更多关于你的信息，以便推荐适合你的职位。请提供以下信息：\n\n1. 教育背景：你的学历和专业是什么？\n2. 工作经验：你有什么相关的工作经验？\n3. 技能：你掌握了哪些技能或证书？\n4. 兴趣领域：你对哪些行业或职位感兴趣？\n5. 地理位置：你希望在哪个地区工作？\n6. 其他要求：例如，期望的薪资、工作时间、公司规模等。\n\n提供这些信息后，我可以更好地帮助你推荐适合的职位。', 'test', 'null', '2025-12-06 09:05:38');

